import React, { Component } from 'react'
import styles from"./sidebar.module.css";
import { withRouter } from 'react-router-dom';

export  class sidebar extends Component {


    render() {
        return (
            <div className={styles.sidebar}>
                <nav>
                    <ul>
                        <li>
                            <i className="fas fa-home" id="icon"></i>
                            <a href='home.html'>HOME</a>
                        </li><hr />
                        <li><i className="fas fa-poll" id="icon"></i><a href='result.html'>RESULTS</a></li><hr/>
                        <li><i className="fas fa-money-check-alt" id="icon"></i><a href='#'>FEES</a></li><hr/>
                        <li><i className="fas fa-book" id="icon"></i><a href='mysubject.html'>MY SUBJECTS</a></li><hr/>
                        <li><i className="fas fa-id-card" id="icon"></i><a href='#'>CONTACT US</a></li><hr/>
                        <li><i className="fas fa-sign-out-alt" id="icon"></i><a href='#'>Logout</a></li><hr/>
                    </ul>
                </nav>    
            </div>
        )
    }
}

export default withRouter(Register);
